//Given two strings, str1 and str2, find the shortest substring in str1 such that str2 is a subsequence of that substring.
//A substring is defined as a contiguous sequence of characters within a string.
// A subsequence is a sequence that can be derived from another sequence by deleting zero or more elements without changing the order of the remaining elements.
use std::collections::hash_map::HashMap;

fn min_window(s1: String, s2: String) -> String {
    let mut min_sub_sequence = "".to_string();

    let mut need: HashMap<char, i32> = HashMap::new();
    let mut window = HashMap::new();

    let chars1 = s1.chars().collect::<Vec<char>>();
    let chars2 = s2.chars().collect::<Vec<char>>();

    for char in chars2 {
        need.entry(char)
            .and_modify(|counter| *counter = *counter + 1)
            .or_insert(1);
    }

    let (mut left, mut right, mut valid, mut start, mut len) = (0, 0, 0, 0, usize::max_value());

    while right < chars1.len() {
        let c = chars1[right];
        right += 1;

        if need.contains_key(&c) {
            window
                .entry(c)
                .and_modify(|counter| *counter = *counter + 1)
                .or_insert(1);
        } else {
            window.insert(c, 1);
        }

        if window.get(&c) == need.get(&c) {
            valid += 1;
        }

        while valid == need.len() {
            dbg!(format!("valid: {}, len: {}", valid, need.len()));
            if right - left < len {
                start = left;
                len = right - left;
            }

            let d = chars1[left];
            left += 1;

            if need.contains_key(&d) {
                if window.get(&d) == need.get(&d) {
                    valid -= 1;
                }
                window
                    .entry(d)
                    .and_modify(|counter| *counter -= 1)
                    .or_insert(1);
            }
        }
    }

    if len == usize::max_value() {
        "".to_string()
    } else {
        chars1[start..start + len as usize]
            .iter()
            .collect::<String>()
    }
}

mod tests {
    use super::*;

    #[test]
    fn testcase1() {
        assert_eq!(
            min_window("".to_string(), "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ".to_string()),
            "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ"
        );
    }

    #[test]
    fn testcase2() {
        assert_eq!(
            min_window("ADOBECODEBANC".to_string(), "ABC".to_string()),
            "BANC"
        );
    }
}
